import React from 'react'
import { Link } from 'react-router-dom'

const Navbar = () => {
  return (
    <div className='navbar'>
      <Link className='navbar' to='/about'>О нас</Link>
      <p></p>
      <Link className='navbar' to='/about1'>О нас</Link>
      <Link className='navbar' to='/about2'>О нас</Link>
    </div>
  )
}

export default Navbar
